import './Dashboard.css'
export default class Dashboard extends React.Component{
state={

addModalShow: false,
      } 
render()
 {
     let addModalClose= ()=> this.setState({addModalShow:false});
    return(

  <div >
<Navbar  >
     <Navbar.Brand href="#home">Welcome To Test Suite Management</Navbar.Brand>
       <Navbar.Toggle />
         <Navbar.Collapse className="justify-content-end">
            <Navbar.Text>
              <a href="#login">Help</a> 
            </Navbar.Text>
    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <Navbar.Text>
              <a href="#login">UserName</a>
            </Navbar.Text>
    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <Navbar.Text>
              <a href="https://www.nineleaps.com/">Logout</a>
            </Navbar.Text>
         </Navbar.Collapse>
    </Navbar>    


<ButtonToolbar>
    <Button className="create"
    variant='danger'
     onClick={()=> this.setState({addModalShow:true})}
    >
      Create+
      </Button>
    <Popup show={this.state.addModalShow} onHide={addModalClose} />
</ButtonToolbar>
<Display/>
<Chart/>

</div>

  );
    }
       }
